INSERT INTO `ecs_merchants_steps_title` VALUES ('19', '6', '新品牌信息', '3', '最多可添加10条品牌信息，更多品牌可以在入驻成功后继续申请开通。', '<div class=\"yel-tip\">\r\n<div class=\"content\">\r\n1. 信息提交前，请务必先了解\r\n<a class=\"link-blue\" target=\"_blank\" href=\"http://help.jd.com/Vender/viewQuestion-1004-2597.html\">大商创开放平台招商资质标准细则；</a>\r\n<br>\r\n2. 经营品牌类信息需填项较多，建议先查看\r\n<a class=\"link-blue\" target=\"_blank\" href=\"http://help.jd.com/Vender/viewQuestion-779-2555.html\">品牌添加注意事项</a>\r\n再进行填写；\r\n<br>\r\n3. 以下所需要上传电子版资质仅支持JPG、GIF、PNG格式的图片，大小不超过1M，且必须加盖企业彩色公章。\r\n</div>\r\n</div>', '1');
